    "options(repr.plot.width = 9, repr.plot.height = 14)\n",
    "\n",
    "produtos %>%\n",
    "    filter(!is.na(product_category_name)) %>%\n",
    "    group_by(product_category_name) %>%\n",
    "    count(sort = T) %>%\n",
    "    ungroup() %>%\n",
    "    mutate(product_category_name = fct_reorder(product_category_name, n)) %>%\n",
    "    ggplot(aes(x = n, y = product_category_name)) + \n",
    "    geom_col() +\n",
    "    labs(x = \"Número de produtos à venda\", y = \"Categoria do produto\", \n",
    "         title = \"Qual a quantidade de produtos de cada categoria à venda na Olist?\", \n",
    "         subtitle = \"Dados de 100 mil pedidos entre 2017 e 2018\") + \n",
    "    theme_light()"
