   "source": [
    "options(repr.plot.width = 10, repr.plot.height = 10)\n",
    "\n",
    "cut_quantiles <- function(x, q) {\n",
    "    x <- sort(x)\n",
    "    i <- order(x)\n",
    "    x[i[i >= quantile(i, min(q)) & i <= quantile(i, max(q))]]\n",
    "}\n",
    "\n",
    "itens %>%\n",
    "    left_join(produtos) %>%\n",
    "    filter(!is.na(product_category_name), !is.na(price), price > 0) %>%\n",
    "    group_by(product_category_name) %>%\n",
    "    summarise(mean_price = mean(price), \n",
    "              min = first(cut_quantiles(price, c(0.05, 0.95))), \n",
    "              max = last(cut_quantiles(price, c(0.05, 0.95))), \n",
    "              n = n()) %>%\n",
    "    ungroup() %>%\n",
    "    mutate(product_category_name = fct_reorder(product_category_name, mean_price)) %>%\n",
    "    ggplot(aes(x = mean_price, y = product_category_name)) + \n",
    "    geom_point(aes(size = n), alpha = 0.5) + \n",
    "    geom_errorbarh(aes(xmin = min, xmax = max), alpha = 0.3) + \n",
    "    labs(x = \"Preço médio dos produtos\\n(e os limites de 95% dos preços)\", y = \"Categoria do produto\", \n",
    "             title = \"Quais os preços médios dos produtos de cada categoria à venda na Olist?\", \n",
    "             subtitle = \"Dados de 100 mil pedidos entre 2017 e 2018\") + \n",
    "    scale_size_continuous(name = \"Número de produtos\") + \n",
    "    scale_x_continuous(labels = dollar_format(prefix = \"R$\", big.mark = \".\", decimal.mar = \",\")) + \n",
    "    theme_light()"
   ]
  },
