   "source": [
    "options(repr.plot.width = 7, repr.plot.height = 7)\n",
    "\n",
    "pedidos %>%\n",
    "    mutate(day_of_week = wday(order_purchase_timestamp, label = T)) %>%\n",
    "    group_by(day_of_week) %>%\n",
    "    count() %>%\n",
    "    ungroup() %>%\n",
    "    mutate(n = n/sum(n)) %>%\n",
    "    ggplot(aes(x = day_of_week, y = n, group = 1)) + \n",
    "    geom_line() + \n",
    "    labs(x = \"Dia da semana\", y = \"Porcentagem de pedidos\", \n",
    "                 title = \"Porcentagem de pedidos por dia da semana\", \n",
    "                 subtitle = \"Dados de 100 mil pedidos entre 2017 e 2018\") +\n",
    "    scale_y_continuous(labels = percent) + \n",
    "    theme_light()"
   ]
  }
